exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://www.xlnwow.com/wapbook-${bid}/`,{cleaner:html=>cleanCatalogWrapper(html,/chapterindex[^>]+>/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};